import { BrowserRouter as Router, Route, Link , Switch } from "react-router-dom";
import React from 'react';
import logo from './logo.svg';
import './App.css';
import Counter from './Counter';
import Nav from './Nav';

function App() {
  return (
    <Router>
    <div className="App">
    <Nav/>
     <Route path="/counter" component={Counter} />           
    </div>
    </Router>
  );
}


export default App;
